def can_equal(s, t):
    # sとtが等しければTrueを返す
    # sとtが等しくなければFalseを返す

    # 両方が空文字列ならTrue
    if s == t == "":
        return True
    # 片方が空文字列ならFalse
    if s == "" or t == "":
        return False
    # 最初の文字が等しいなら次の文字を比較
    if s[0] == t[0]:
        return can_equal(s[1:], t[1:])
    # 最初の文字が異なるときは、s[0]とt[0]を入れ替えて比較
    else:
        return can_equal(s[1:], t[0] + t[1:])


def main():
    # 入力
    s = input()
    t = input()

    # 出力
    if can_equal(s, t):
        print("Yes")
    else:
        print("No")


if __name__ == "__main__":
    main()

def cnt(s):
    cnt_dict = {}
    for c in s:
        if c in cnt_dict:
            cnt_dict[c] += 1
        else:
            cnt_dict[c] = 1
    return cnt_dict


def main():
    s = input()
    t = input()
    s_dict = cnt(s)
    t_dict = cnt(t)
    if s_dict == t_dict:
        print('Yes')
    else:
        print('No')


